import React from 'react';

function TitleAndSubtitle() {
  return (
    <div className="title-container">
      <h1>RECIPES</h1>
      <h2>Explore Our <span>Recipes</span></h2>
      <p>Find delicious recipes for every taste ans occasion. Quick, easy, and tailored to your needs!</p>
    </div>
  );
}

export default TitleAndSubtitle;
